fn bench_bndm(b: &mut Bencher) {
    b.iter(|| {
        for _ in 0..10000 {
            let bndm = BNDM::new(PATTERN);
            bndm.find_all(TEXT).collect::<Vec<usize>>();
        }
    });
}

